import React, { useEffect, useState } from 'react';
import './App.css';

import scale from './assets/radaltback.png';
import cover from './assets/radaltcover.png';
import needle from './assets/radaltneedle.png';
import bugImg from './assets/bug.png';
import flagImg from './assets/radaltflag.png';
import redlight from './assets/redlight.png';

function App() {
  const [check, setCheck] = useState(true)
  const [Altitude, setAltitude] = useState(0)
  const [Bug, setBug] = useState(0)
  const True = true

  function changeCheck() {
    setCheck(!check)
    if (check == True) {
      console.log('redlight');
      <img className='redlight' src={redlight}></img >
    }

  }


  function ChangeAlt() {
    setAltitude(Altitude)
  }

  return (
    <div>
      <div className='parent'>
        <h1>Radar Altimeter</h1>
        <img className='scale' src={scale}></img>
        <img className='flagImg' src={flagImg}></img>
        <img className='needle' src={needle}></img>
        <img className='cover' src={cover}></img>
        {{ check } == true && <h2>ligma </h2>}
        <div className='light'></div>
        <img className='bugImg' src={bugImg}></img>
      </div>
      <footer className='footer'>
        <div><label>Altitude: <span id='AltitudeNumber'></span></label><input className='AltitudeSlider' type='range' min='0' max='1500' value={Altitude} onChange={ChangeAlt}
        /></div>
        <div><label for='BugSlider' className='BugLabel'>Bug: <span id='BugNumber'></span></label><input className='BugSlider' type='range' min='0' max='1500'
        /></div>
        <div><label for='PowerCheckBox' className='PowerLabel'>  Has power: </label><input className='PowerCheckBox' type='checkbox' value={check} onChange={changeCheck}
        /></div>
      </footer>
    </div >
  );
}

export default App;
